import React, { useState } from 'react';
import ServiceCard from './ServiceCard';
import ColabsCard from './ColabsCard';

const Colaborators = () => {
  const [colabs, setColabs] = useState([
    {
      id: 1,
      title: 'Service 1',
      description: 'Description for Service 1',
    },
    {
      id: 2,
      title: 'Service 2',
      description: 'Description for Service 2',
    },
    {
      id: 3,
      title: 'Service 3',
      description: 'Description for Service 3',
    },
    {
      id: 4,
      title: 'Service 4',
      description: 'Description for Service 4',
    },
    {
      id: 5,
      title: 'Service 5',
      description: 'Description for Service 5',
    },
    {
      id: 6,
      title: 'Service 6',
      description: 'Description for Service 6',
    },
  ]);

  return (
    <>
      <div className="services-square"></div>
      <div className="our-services-container">
        <h3>Nuestros Colaboradores</h3>
        {colabs.map((service) => (
          <ColabsCard key={service.id} title={service.title} description={service.description} />
        ))}
      </div>
    </>
  );
};

export default Colaborators;
